import React from 'react'

function Footer(attr) {
    return (
      <div className="footer-component">
        <footer className="mastfoot mt-auto">
          <div className="inner">
            <p>Corso Front End, by <strong>Tutti i corsisti!</strong></p>
          </div>
        </footer>
      </div>
    );
  }

  export default Footer;
